import React from 'react'
import '../css/products.css'
import product_logo from '../assets/images/coffee_bag.png'
import {products} from '../elements/products_data'

function Products(){

    const products_card = products.map((product) => {
        return(
        <div className='product-card'>
                <img src={product_logo} alt='producto' />
                <h3 className='product-name'>{products.name}</h3>
        </div> 
        )
    })

    return(
        <div className="products-section">
            <div className='products-container'>
                <div className='product-card'>
                    <img src={product_logo} alt='producto' />
                    <h3 className='product-name'>{products.name}</h3>
                </div>
            </div>
        </div>
    );
};

export default Products;
